object Solution {
    def minOperations(nums: Array[Int], k: Int): Int = {
        val xor = nums.foldLeft(0)(_ ^ _)
        val target = xor ^ k
        if (target == 0) 0
        else {
            val bitCounts = Array.fill(32)(0)
            nums.foreach(n => (0 until 32).foreach(i => if (((n >> i) & 1) == 1) bitCounts(i) += 1))
            var ops = 0
            var found = false
            for (i <- 31 to 0 by -1 if !found) {
                if (((target >> i) & 1) == 1) {
                    if (bitCounts(i) > 0) {
                        found = true
                        ops = 1
                    }
                }
            }
            if (!found) -1 else ops
        }
    }
}
